(44, 17, 162, 4, 21, 'Biloela', '11 Sellheim Street', '4715', '', 7, 'Get Rich Click Book By Marc Ostrofsky', 'This book is in an excellent condition. A very good book to read for someone who wants to start up an online business. All ideas in one, i guarantee you will love reading this book. Send me an email if you want o know more about this book', '', 10.00, '', '', 0, 0, '', '', '', '', '', 0, '', 'New York Times Best Seller', 'Offering', 'Private', '', 'Used', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, '', '', 3508, 1, '2014-05-19', '02:44:22', 1, 767, '', NULL, NULL, NULL),
(49, 10, 209, 4, 21, 'Biloela', '46 Joe Kooyman Dr, Biloela, Qld', '4715', '', 12, 'SanDisk Ultra 8GB SD- SDHC Class 10 UHS-1 Memory Card for Cameras (40ms/s)', 'Product Description:\r\n\r\nIf you need better pictures and videos than this is the card you need. It is twice as fast compared to other ordinary ones out there in the market\r\nYou can record full HD 1080p video with this Class 10 compliant 8GB Ultra UHS-I SDHC Memory Card for yourself, friends or loved ones- creating unforgettable moments and memories.\r\nWith enhanced data read speeds of up to 40MB/s this Ultra SDHC memory card is designed to suit the needs of compact and mid-range point and shoot cameras.\r\nAnd not only that you can also save and store a variety of files such as music, movies, documents and more.\r\n Compatibility:\r\n\r\nThis card is completely compatible with cameras, laptops, tablets and other devices that supports micro SDHC.\r\nSpecifications:\r\n\r\nUp To 40MB/s Read Speed\r\nMax. Read Speed: 40MB/s 266X Min. Write Speed: 10MB/s\r\nClass 10 / UHS-I\r\nWaterproof, temperature proof, x-ray proof, magnet proof, and shock proof\r\n Condition:\r\n\r\n100% Brand NEW- it has never been used or opened\r\nNo scratches or marks visible- concealed in new box ready for postage\r\nDurability:\r\n\r\nIt will last long if you look after it well.\r\n Return Policy:\r\n\r\nCustomer satisfaction is our number 1 priority and the product we sell comes with 7 days money back guarantee after the customer receives the product. However, the customer pays for the return postage fees.', '', 10.99, '', '', 0, 0, '', '', '', '', '', 0, '', 'SanDisk Ultra 8GB SD Memory Card', 'Offering', 'Private', '', 'New', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, '', '', 1680, 1, '2017-07-04', '08:18:34', 1, 965, '', NULL, NULL, NULL),
(71, 10, 209, 3, 313, 'Collinsville', '12 Bulloch St', '4803', '0497707823', 53, 'Epson 133 Magenta Ink Cartridge (N86)', 'Description:\r\nThis Epson T133 Standard Ink Cartridge is an awesome alternative for ordinary printing at home or in the work environment. It\'s intended to create superb prints with striking and clear content and pictures. \r\n\r\nThis cartridge can be known by the maker\'s code, C13T133392. \r\n\r\nIt has an expected page yield of 360 pages. \r\n\r\nIt\'s perfect with the Epson Stylus N11, NX125, NX420 and the Epson Workforce 320, 325. \r\n\r\nCondition:\r\n* 100% Brand new and Genuine\r\n\r\nLocation:\r\n* This product is located in Central Queensland-Australia', '', 18.00, '', '', 0, 0, '', '', '', 'Yamaha', '', 0, '', 'new', 'Offering', 'Private', '', 'New', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 1131, 1, '2019-04-27', '22:16:49', 1, 1131, 'Sale', '', NULL, NULL),
(72, 10, 209, 3, 313, 'Collinsville', '12 Bulloch St', '4803', '0497707823', 53, 'New iPhone 6/6S Screen Protector-Tempered Glass Screen Protector', 'Product Description: \r\nUltra thin and ultra clear screen protector is designed to provide exceptional crisp and clear visibility and transparency while maintaining the stunning display quality of your iphone 6/6S \r\nGuardian for the Screen: \r\nScratch resistant screen protector guards your device\'s screen against unwanted damage and scratches, dust, and dirt. The screen protector\'s 3H hard coating surface is designed to provide protection without affecting the responsiveness of your display.\r\n\r\nPackage:\r\n* 1 x Tempered clear Screen Protector\r\n* Application Kits', '', 10.00, '', '', 0, 0, '', '', '', 'Yamaha', '', 0, '', 'new', 'Offering', 'Private', '', 'New', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 780, 1, '2019-04-27', '22:48:26', 1, 780, 'Sale', '', NULL, NULL),
(73, 10, 209, 3, 313, 'Collinsville', '12 Bulloch ST', '4803', '0497707823', 53, 'New iPhone 6/6S Case-Slimline & lightweight', 'Product Description: \r\nUltra thin and ultra clear screen protector is designed to provide exceptional crisp and clear visibility and transparency while maintaining the stunning display quality of your iphone 6/6S \r\nGuardian for the Screen: \r\nScratch resistant screen protector guards your device\'s screen against unwanted damage and scratches, dust, and dirt. The screen protector\'s 3H hard coating surface is designed to provide protection without affecting the responsiveness of your display.\r\n\r\nPackage:\r\n* 1 x Tempered clear Screen Protector', '', 11.00, '', '', 0, 0, '', '', '', 'Yamaha', '', 0, '', 'new', 'Offering', 'Private', '', 'New', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 757, 1, '2019-04-27', '22:57:31', 1, 757, 'Sale', '', NULL, NULL),
