(2, 'Advertise With Us', 'Advertise With Us', 0, 0, 0, 'Advertise With Us', 'Please send all your advertising inquiries to enways17@gmail.com. One of our sales consultants will be in touch with you soon', 'advertise-with-us'),
(3, 'FAQs', 'FAQs', 0, 0, 0, 'FAQs', '<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">What is Gopiko.com.au?</span><br />\r\n	.<br />\r\n	Welcome to www.gopiko.com.au - Australia\'s 100 % FREE Classified Site. Gopiko.com.au is an online classifieds network, a marketplace platform for buying and selling services and goods such as electronics, fashion items, furniture, household goods, Properties, cars, clothes, machinery etc just to name a few. If you are looking for stuff like this then you have come to the right place . Gopiko.com.au is the place to be. It is the easiest way to reach, buy, sell or trade and to interact with people with common interests across the local communities in Australia . We warm welcome you to be part of this online community.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How much does it cost to post an Ad?</span><br />\r\n	Posting an Ad is absolutely free. However, Only PREMIUM Ads take priority positioning on search results</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How many Ads can i post on gopiko?</span><br />\r\n	You can post unlimited ads. There is no limit.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How long will the ads be online for?</span><br />\r\n	Free ads will be online as long as long as it takes. However, Premium Ads will expire between 30-90 days depending on the package you choose</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i post an Ad?</span><br />\r\n	To post an Ad, please clcik on \" POST FREE AD\" green tab and register first then follow the prompts to create your first Ad</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i include photos in an Ad?</span><br />\r\n	You will find \"Upload Photos\" tab when creating your ad. Click on that tab and it will allow you to upload images from your computer. You will be only allowed to upload 5 photos for each ad</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How can i delete my Ad?</span><br />\r\n	Log into your account, select \"MY Ads\" tab in your account area and delete the ad that you wish</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i update and delete my account information?</span><br />\r\n	Log into your account and clcik on \"SETTINGS\" tab and update your information</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">What are the Ad posting rules on Gopiko?</span><br />\r\n	As a condition of your use of Gopiko.com.au you agree that you :<br />\r\n	 shall not be fraudulent, misrepresent, mislead or pertain to the sale of any illegal, counterfeit, stolen goods and / or services<br />\r\n	 shall not pertain to good , services of which you are not the lawful owner or you do not have the authority or consent to \'list\' which do not belong to you or you do not have the authority for  shall not infringe any intellectual property, trade secret, or other proprietary right or rights of publicity or privacy of any third party;<br />\r\n	 shall not consist of material that is an expression of bigotry, racism or hatred based on age, gender, race, religion, caste, class, lifestyle preference, and nationality and / or is in the nature of being derogatory, slanderous to any third party;<br />\r\n	 shall not be obscene, contain pornography or contain indecent representation of mankind<br />\r\n	 shall not distribute or contain spam, multiple / chain letters, or pyramid schemes in any of its forms;<br />\r\n	 shall not distribute viruses or any other technologies that may harm Gopiko.com.au or the interests or property of Gopiko.com.au users or impose an unreasonable load on the infrastructure or interfere with the proper working of Gopiko<br />\r\n	 shall not, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any goods and services, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force.<br />\r\n	 shall not be placed in a wrong category or in an incorrect area of the site;<br />\r\n	 shall not be placed in any other Gopiko.com.au site except on the site that relates to the city in which you are located;<br />\r\n	 shall not list or post or pertain to information that is either prohibited or restricted under the laws of the Australia</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i reply to an Ad?</span><br />\r\n	Browse to the ads displayed on the search pages and simply click on the REPLYbutton and enter your name, email, phone number and leave a message in the message form and clcik on thesubmit button. A conformation message will be displayed confirming your recent activity.</p>', 'faqs'),
(4, 'About Us', 'magrack,best reseller in magine', 0, 0, 0, 'About Us', 'Welcome to www.gopiko.com.au - Australia\'s 100 % FREE Classified Site.\r\n\r\nwww.gopiko.com.au is an online classifieds network, a marketplace platform for buying and selling services and goods such as electronics, fashion items, furniture, household goods, Properties, cars, clothes, machinery etc just to name a few. \r\nIf you are looking for stuff like this then you have come to the right place . www.gopiko.com.au is the place to be. It is the easiest way to reach, buy, sell or trade and to interact with people with common interests across the local communities in Australia . We warm welcome you to be part of this online community.', 'about-us'),
(6, 'Privacy Policy', 'Privacy Policy', 0, 0, 0, 'Privacy Policy', '<div>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Australian Privacy Act Compliance</strong></span><br />\r\n		Because we value your privacy, we have taken the necessary precautions to be in compliance with the Privacy Act 1988 (Cth). The Privacy Act 1988 (Cth) incorporates the National Privacy Principles which set out the way in which personal information must be treated. We will treat all personal information held by us in accordance with those Principles.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Who does the Goiko.in Privacy Policy apply to?</strong></span><br />\r\n		This Policy applies to any persons in respect of whom we currently hold personal information or whom we may in the future collect personal information from.<br />\r\n		<br />\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>What information do we collect?</strong></span><br />\r\n		We collect information from you when you register on our site, place an order or fill out a form. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address or phone number. You may, however, visit our site anonymously. In order to place an advertisement on the Gopiko.ph website, we will require you to supply payment details, your postcode, your equipment details, a land-line or mobile number and e-mail address. Credit Card information is entered over a secure connection and is not recorded in any way by Gopiko.ph<br />\r\n		.<br />\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>What do we use your information for?</strong></span><br />\r\n		We use users\' personal information to:<br />\r\n		 provide our services;<br />\r\n		 resolve disputes, collect fees, and troubleshoot problems;<br />\r\n		 encourage safe trading and enforce our policies;<br />\r\n		 customize users\' experience, measure interest in our services, and inform users about services and updates;<br />\r\n		 communicate marketing and promotional offers to you;<br />\r\n		 Do other things for users as described when we collect the information.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Do we use cookies?</strong></span><br />\r\n		Yes - Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information. We use cookies to help us remember and process the items in compiling aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.<br />\r\n		We do not use cookies to collect personally identifiable information about a person. If you prefer, you can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies via your browser settings. Like most websites, if you turn your cookies off, some of our services may not function properly. However, you can still place orders over the telephone.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Disclosure Of Information</strong></span>.<br />\r\n		 All information contained by Gopiko.ph is treated as strictly confidential and Gopiko.ph does not and will not disclose or share such confidential information to / with any external organization.<br />\r\n		 The users privacy is very important to us. We do not and shall not at any point in time, either sell or rent users personal information to third parties without users explicit consent.<br />\r\n		 We may be required from time to time to disclose users personal information to Governmental or law enforcing agencies or our regulators, but we will only do so under proper authority.<br />\r\n		 Gopiko.ph also reserves the right to make use of the personal information in any investigation or judicial process relating to fraud on account of such transactions during the period Gopiko.ph retains such information.<br />\r\n		 We may also disclose personal information to enforce our policies, respond to claims that a posting or other content violates others rights, or protects anyones rights, property or safety.<br />\r\n		 We may also share personal information with:<br />\r\n		- Corporate affiliates who help detect or prevent potentially illegal acts and provide joint services (Our corporate affiliates will market only to users who ask them to).</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Third party links</strong></span><br />\r\n		Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites. In addition, you agree that we may send you promotions and offers from a third party which we feel may be of interest to you.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Your Consent</strong></span><br />\r\n		By using our site, you are deemed to consent to our online privacy policy.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Changes to our Privacy Policy</strong></span><br />\r\n		If we decide to change our privacy policy, we will post those changes on this page.</p>\r\n</div>\r\n<p>\r\n	</p>', 'privacy-policy'),
(7, 'Terms of Use', 'Terms of Use', 0, 0, 0, 'Terms of Use', '<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<strong>Welcome to web services provided by Gopiko.sg (hereinafter referred to as \"we\", services, \"Gopiko or Gopiko.sg). By accessing our web sites you (\"you\" or \"User\") agree to be bound by these terms and conditions, the Privacy Policy, the Refund Policy and the Advertising Rules, all of which form part of the agreement between you and us (Agreement). Please read them carefully.</strong></p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>1. General Provisions</strong></span><br />\r\n	Gopiko Pty Ltd (\"GOPIKO\") provides a collection of online resources, including classified listings, advertising, email services and links to third party sites (referred to hereafter as \"the Service\"), available at the URL<a _fcksavedurl=\"http://www.Gopiko.sg/\" href=\"http://www.Gopiko.sg/\">http://www.Gopiko.sg/</a>(the \"Site\"), that are subject to the following Terms of Use (\"Terms\"). By using the Site or the Service in any way, you agree to comply with these Terms. In addition, when using particular Gopiko services, you agree to abide by any applicable posted guidelines for those services, which may change from time to time. Please report any violation of these Terms to<a _fcksavedurl=\"mailto:info@Gopiko.sg\" href=\"mailto:info@Gopiko.sg\">info@Gopiko.sg</a>. Should you object to any term or condition of these Terms, any guidelines, or any subsequent modifications thereto or become dissatisfied with Gopiko in any way, your only recourse is to immediately discontinue use of the Site and the Service. Gopiko will not be held be liable for any loss or damage for non-compliance.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>2. Registration</strong></span><br />\r\n	To obtain access to Gopiko.sg services, you are required to (a) give your contact details and other personal information by filling in a registration form provided online and b) agree to be bound by this Agreement. Gopiko.sgretains the information you provided so that you may use the web site without having to re-enter your information and it will be kept and used in accordance with our Privacy Policy. Only persons capable of forming legally binding contracts under applicable law may register as a user of the web sites. Without limiting the foregoing, the services are not available to persons under 18 years of age.<br />\r\n	Gopiko.sg has the right to refuse any future use of the web site if it has reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete or if you do not follow the terms and conditions of this Agreement. Gopiko.sg may additionally resort to any available legal remedies.<br />\r\n	As part of the registration process you are requested to select a user name and a password. It is your responsibility to preserve the confidentiality of the user name and password and notify Gopiko.sg by e-mail (<a _fcksavedurl=\"mailto:info@Gopiko.sg\" href=\"mailto:info@Gopiko.sg\">in@Gopiko.sg</a>) of any known or suspected unauthorized use of the user name and password. Until receipt of such notification you are responsible for all use of the website using the user name and password.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>3. Privacy</strong></span><br />\r\n	Gopiko.sg is committed to protecting the privacy of the users of its web site and uses all reasonable efforts to ensure that the retained data is protected against unauthorized access. However, we cannot guarantee that the information you supply won\'t be intercepted while being transmitted to us over the Internet. Gopiko.sg will not disclose your information to any third parties or your user information (e.g. user name and e-mail address) without your consent. Full details of our Privacy Policy are available by following the link at the bottom of this page.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>4: Using Gopiko</strong></span><br />\r\n	You agree and understand that<a _fcksavedurl=\"http://www.Gopiko.sg\" href=\"http://www.Gopiko.sg/\">www.Gopiko.sg</a> is an internet enabled platform that facilitates communication for the purposes of advertising and distributing information pertaining to goods and/ or services. You further agree and understand that we do not endorse, market or promote any of the listings, postings or information, nor do we at any point in time come into possession of or engage in the distribution of any of the goods and/ or services, you have posted, listed or provided information about on our site. While interacting with other users on our site, with respect to any listing, posting or information we strongly encourage you to exercise reasonable diligence as you would in traditional off line channels and practice judgment and common sense before committing to or complete intended sale, purchase of any goods or services or exchange of information.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	As a condition of your use of Gopiko.sg you agree that you :<br />\r\n	 shall not be fraudulent, misrepresent, mislead or pertain to the sale of any illegal, counterfeit, stolen goods and / or services<br />\r\n	 shall not pertain to good , services of which you are not the lawful owner or you do not have the authority or consent to \'list\' which do not belong to you or you do not have the authority for  shall not infringe any intellectual property, trade secret, or other proprietary right or rights of publicity or privacy of any third party;<br />\r\n	 shall not consist of material that is an expression of bigotry, racism or hatred based on age, gender, race, religion, caste, class, lifestyle preference, and nationality and / or is in the nature of being derogatory, slanderous to any third party;<br />\r\n	 shall not be obscene, contain pornography or contain indecent representation of mankind<br />\r\n	 shall not distribute or contain spam, multiple / chain letters, or pyramid schemes in any of its forms;<br />\r\n	 shall not distribute viruses or any other technologies that may harm Gopiko.sg or the interests or property of Gopiko.sg users or impose an unreasonable load on the infrastructure or interfere with the proper working of Gopiko<br />\r\n	 shall not, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any goods and services, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force.<br />\r\n	 shall not be placed in a wrong category or in an incorrect area of the site;<br />\r\n	 shall not be placed in any other Gopiko.sg site except on the site that relates to the city in which you are located;<br />\r\n	 shall not list or post or pertain to information that is either prohibited or restricted under the laws of the Australia</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>5. Advertising/Posting an Advert</strong></span><br />\r\n	By inputting or sending your advertisement to Gopiko.sg, you request that the advertisement be published on our services. A valid contract is made between Gopiko.sg and the user once we have verified and accepted your advertisement copy. It is the sellers responsibility to specify where each advertisement is to be published at Gopiko.sg, and/or in the sellers own intranet/extranet service. Gopiko.sg reserves the right to reject or withdraw an advertisement at its discretion if it considers that an advertisement does not comply with the Advertising Rules, available by following the link at the bottom of the page or for any other reason.<br />\r\n	Gopiko.sg will contact you by e-mail if your advertisement for some reason is not fit for publication. Gopiko.sg may deny access to the web site for users that do not act professionally or in accordance with good practice. The preconditions for publishing are evaluated individually for each advertisement.<br />\r\n	It is your responsibility as the seller to give true and complete product information on your listing whether it be FREE or PAID and clearly indicating and their condition as well as all other details that might be relevant for a potential buyer in accordance with applicable law, administrative statutes and good business practice. You agree to be bound by the guarantee, price and other information you have given on the advertisement.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>6 Dealings with organizations or individuals</strong></span><br />\r\n	Gopiko.sg shall not be liable for your interactions with any organizations and/or individuals found on the Site or through the Service. This includes, but is not limited to, payment and delivery of goods and services, and any other terms, conditions, warranties or representations associated with such dealings. These dealings are solely between you and such organizations and/or individuals. You agree that Gopiko.sg is not responsible for any damage or loss incurred as a result of any such dealings. Gopiko is under no obligation to become involved in disputes between participants on the Site, or between participants on the Site and any third party. In the event of a dispute, you release Gopiko, its officers, employees, agents and successors in rights from claims, damages and demands of every kind, known or unknown, suspected or unsuspected, disclosed or undisclosed, arising out of or in any way related to such disputes and our service.<br />\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>7 Privacy & Information Disclosure</strong></span><br />\r\n	Gopiko.sg has a Privacy Policy that explains to users how their information is collected and used. A copy of the current version of our Privacy Policy can be found at<a _fcksavedurl=\"http://www.Gopiko.sg/privacy\" href=\"http://www.Gopiko.sg/privacy\">http://www.Gopiko.sg/privacy</a>Policy/. Your use of the Site or the Service signifies acknowledgement of and agreement to our Privacy Policy.<br />\r\n	You further acknowledge that Gopiko.sg may, in its sole discretion, preserve or disclose your Content, as well as your information, such as email addresses, IP addresses, timestamps, and other user information, if required to do so by law or in the good faith belief that such preservation or disclosure is reasonably necessary to comply with the legal process, enforce</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>8. Product Information</strong></span><br />\r\n	Gopiko.sg draws your attention to the fact that all information advertised in the web sites originates entirely from the seller of items. The seller alone has evaluated and given his opinions on the condition of this piece of item. The evaluation is therefore not made by any impartial third party and Gopiko.sg does not take any responsibility for the truthfulness or accuracy of such evaluation.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>9 Intellectual Property Rights</strong></span><br />\r\n	All intellectual property rights in the content such as text, graphics, software and other material of the web site as well as the arrangement and compilation of such content are the property of Gopiko.sg (apart from third party content) and protected by Australian laws. All use including distribution, publication, reproduction, display or other exploitation of the content on the web site is strictly prohibited unless expressly authorised in writing by us.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>10 Breach</strong></span><br />\r\n	Without limiting other remedies available to Gopiko.sg available at law, in equity or under this Agreement, we may, in our sole discretion immediately issue a warning, temporarily suspend, indefinitely suspend or terminate your registration and refuse to provide the services to you if:<br />\r\n	(a) you breach this Agreement or any of the terms and policies incorporated by reference;<br />\r\n	(b) we are unable to verify or authenticate any Information you provide to us;<br />\r\n	(c) we believe that your actions may cause legal liability for you, other users or us.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>11. Warranty</strong></span><br />\r\n	The contents of the site is provided \"as is\" and \"as available\". No warranty or condition, either express or implied, is made in relation to the accuracy, reliability or contents of the site. To the maximum extent permitted by law, we and our providers specifically disclaim any implied warranties of title, merchantability, fitness for a particular purpose and non-infringement.<br />\r\n	We do not warrant that the site or the servers that provide it are free of errors, viruses or other harmful components. We reserve the right to alter the site or withdraw access to it at our sole discretion.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>12. Liability</strong></span><br />\r\n	You agree not to hold Gopiko.sg or any of its officers, employees, agents responsible or accountable for any of your listing, postings or information and nor shall we, our officers, employees or agents be liable for any misuse, illegal activity or third party content as most postings, listings or information are generated by various users directly and we do not have any role in the creation, publication or distribution of the posting, listing or information, nor are we in a position to have editorial control over the substance or content contained in the listings, postings, or information, save and except . You understand and agree that we do not guarantee the accuracy or legitimacy of any listing, posting, information by other users. You further agree that we are not liable for any loss of money, goodwill, or reputation, or any special, indirect, or consequential damages arising out of your use of the site or as a result of any sale, purchase of goods and services with other users of the site. We also cannot guarantee continuous or secure access to our Services. Accordingly, to the extent legally permitted we exclude all implied warranties, of merchantability, fitness or quality of the Site and our services.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>13. Indemnity</strong></span><br />\r\n	To the maximum extent permitted by law, the user indemnifies and agrees to hold Gopiko.sg, its officers and employees (Those Indemnified) harmless against and from all Claims which may arise as a result of or in connection with the users use of the website, our services or this Agreement, including but not limited to your breach of this Agreement, your negligence, any untrue, false or misleading information or statement disclosed in an advertisement listed with your account. Gopiko.sg holds the benefit of this indemnity on trust for Those Indemnified and Those Indemnified will be entitled to rely on the indemnity and have the user pay for all costs (including but not limited to legal costs on a solicitor and own client or indemnity basis) prior to Those Indemnified having incurred and paid such costs.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>14. Amendments to Agreement</strong></span><br />\r\n	Internet is an evolving medium. Gopiko.sg may change the terms of this Agreement from time to time in which case we will post the revised terms on the web site. Except as stated below, all amended terms shall automatically be effective after they are initially posted on our website. If you do not agree with such changes, you must terminate your subscription to Gopiko.sg By continuing to use this service following such changes you agree to be bound by the amended Agreement. This Agreement may not otherwise be amended except in writing, signed by you and Gopiko.sg.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>15. Feedback</strong></span><br />\r\n	If you have any comments or improvement suggestions regarding the web site, please forward your comments and/or a copy of the material you believe to be inaccurate to the address (<a _fcksavedurl=\"mailto:info@Gopiko.sg\" href=\"mailto:info@Gopiko.sg\">info@Gopiko.sg</a>) along with an explanation of your objection or suggestion<br />\r\n	.<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>16. Invalidity of Provisions</strong></span><br />\r\n	If any provision or provisions of this Agreement shall be held to unenforceable, such provision shall be enforced to the fullest extent permitted by applicable law.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>17. Term and Termination</strong></span><br />\r\n	This Agreement comes into effect when you register and accept the terms and conditions and they are in force until further notice. .sg may at any time and at its sole discretion deny access to the web site from a User for any reason.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>18. Governing Law and Jurisdiction</strong></span><br />\r\n	This Agreement and the relationship between the user and Gopiko.sg shall be governed by and interpreted in accordance with the laws of Australia excluding its rules for choice of law. All disputes that cannot be solved amicably shall be finally settled by court of law</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	</p>', 'terms-of-use'),
